import React, { useState } from 'react';
import TraineeDetailsPage from './TraineeDetailsPage';
import '../styles/MentorHomePage.css';

function MentorHomePage() {
  const [trainees, setTrainees] = useState([
    { id: 1, name: 'Alice', age: 22, gender: 'female' },
    { id: 2, name: 'Bob', age: 25, gender: 'male' },
    { id: 3, name: 'Charlie', age: 20, gender: 'male' },
    { id: 4, name: 'David', age: 24, gender: 'male' },
    { id: 5, name: 'Emma', age: 23, gender: 'female' },
    { id: 6, name: 'Frank', age: 21, gender: 'male' },
    { id: 7, name: 'Grace', age: 22, gender: 'female' },
    { id: 8, name: 'Harry', age: 26, gender: 'male' },
    { id: 9, name: 'Isabelle', age: 20, gender: 'female' },
    { id: 10, name: 'Jack', age: 23, gender: 'male' },
    { id: 11, name: 'Katherine', age: 21, gender: 'female' },
    { id: 12, name: 'Lucas', age: 25, gender: 'male' },
    { id: 13, name: 'Maggie', age: 22, gender: 'female' },
    { id: 14, name: 'Nate', age: 24, gender: 'male' },
    { id: 15, name: 'Olivia', age: 23, gender: 'female' },
    { id: 16, name: 'Patrick', age: 20, gender: 'male' },
    { id: 17, name: 'Quinn', age: 26, gender: 'female' },
    { id: 18, name: 'Ryan', age: 21, gender: 'male' },
    { id: 19, name: 'Sophie', age: 25, gender: 'female' },
    { id: 20, name: 'Tom', age: 22, gender: 'male' },
    { id: 21, name: 'Uma', age: 24, gender: 'female' },
    { id: 22, name: 'Victor', age: 23, gender: 'male' },
    { id: 23, name: 'Wendy', age: 20, gender: 'female' },
    { id: 24, name: 'Xander', age: 26, gender: 'male' },
    { id: 25, name: 'Yasmine', age: 21, gender: 'female' },
    { id: 26, name: 'Zach', age: 25, gender: 'male' },
  ]); // array of trainee objects
  const [currentPage, setCurrentPage] = useState(1);
  const [traineesPerPage] = useState(10);
  const [selectedTrainee, setSelectedTrainee] = useState(null);

  // Logic for displaying current trainees
  const indexOfLastTrainee = currentPage * traineesPerPage;
  const indexOfFirstTrainee = indexOfLastTrainee - traineesPerPage;
  const currentTrainees = trainees.slice(indexOfFirstTrainee, indexOfLastTrainee);

  // Logic for displaying page numbers
  const pageNumbers = [];
  for (let i = 1; i <= Math.ceil(trainees.length / traineesPerPage); i++) {
    pageNumbers.push(i);
  }

  const handleClick = (event) => {
    setCurrentPage(Number(event.target.id));
  };

  const handleTraineeClick = (id) => {
    const selected = trainees.find((trainee) => trainee.id === id);
    setSelectedTrainee(selected);
  };

  return (
    <div className="mentor-homepage-container">
      <h1 className="mentor-homepage-heading">Trainees Info</h1>
      <div className="trainees-container">
        {currentTrainees.map((trainee) => (
          <div key={trainee.id} className="trainee-item" onClick={() => handleTraineeClick(trainee.id)}>
            {trainee.name}
          </div>
        ))}
      </div>
      <div className="pagination-container">
        <ul className="pagination">
          {pageNumbers.map((number) => (
            <li key={number} className="page-item">
              <button className="page-link" id={number} onClick={handleClick}>
                {number}
              </button>
            </li>
          ))}
        </ul>
      </div>
      {selectedTrainee && <TraineeDetailsPage trainee={selectedTrainee} />}
    </div>
  );
}

export default MentorHomePage;
